import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/custom.css";

const About = () => {
  const navigate = useNavigate();

  return (
    <div className="about-container">
      <img src="/about.jpg" className="about-bg" alt="About Us" />
      <div className="about-content">
        <h1>Welcome to RecipeShare</h1>
        <p>Discover, share, and enjoy amazing recipes from around the world.</p>
        
        <div className="about-buttons">
          <button className="btn btn-primary" onClick={() => navigate("/login")}>
            Login
          </button>
          <button className="btn btn-success" onClick={() => navigate("/register")}>
            Register
          </button>
        </div>
      </div>
    </div>
  );
};

export default About;
